import React from 'react';
import Card from './Card';
import sdata from  './sdata';


const favSeries = "Netflix1";

const Favs = (favSeries) => {
  if (favSeries==="Netflix"){
    return (
      <Card 
        key    = {sdata[0].id}
        imgsrc = {sdata[0].imgsrc}
        title  = {sdata[0].title}
        stitle = {sdata[0].stitle}
        link   = {sdata[0].link}
      />
      );
    }
    else {
      return (
        <Card 
          key    = {sdata[0].id}
          imgsrc = {sdata[0].imgsrc}
          title  = {sdata[0].title}
          stitle = {sdata[0].stitle}
          link   = {sdata[0].link}
        />
            );
        }
}



    
const App = () =>(
                     <>
                        <h1 className="heading_style ">list of top 5 seris</h1>
                         {Favs()}
                    </>
  
                );
export default App;
